import React, { useState } from 'react';
import { settings } from 'config/C4';

const OverViewContributions = () => {
    const { accessToken } = settings;
    const [contribututions, setContributions] = useState({});
    const getContributions = async (token, username) => {
        const headers = {
            'Authorization': `bearer ${accessToken}`,
        }
        const body = {
            "query": `query {
                user(login: "Janneke Coumans") {
                  name
                  contributionsCollection {
                    contributionCalendar {
                      colors
                      totalContributions
                      weeks {
                        contributionDays {
                          color
                          contributionCount
                          date
                          weekday
                        }
                        firstDay
                      }
                    }
                  }
                }
              }`
        }
        const response = await fetch('https://api.github.com/graphql', { method: 'POST', body: JSON.stringify(body), headers: headers })
        const data = await response.json();
        console.log(data);
        return data
    }

    getContributions();

    return (
        <h1>OverViewContributions</h1>
    )
}

export default OverViewContributions;
